// });

const Resume = () => {
  // const [numPages, setNumPages] = useState(null);
  // const [pageNumber, setPageNumber] = useState(1);
  return (
    <>
      <Navbar />
      <Box
        style={{
          width: "34%",
          margin: "auto",
          border: "2px black solid",
        }}
      >
        <Document file={resume}>
          <Page pageNumber={1}></Page>
        </Document>
      </Box>
      <WorkExperience />
      <Contact />
    </>
  );
};

export default Resume;
